import React, { Fragment } from 'react';
import Gasto from "./Gasto";
import PropTypes from "prop-types";

const Listado = ({ gastos }) => (
    <div className="gastos-realizados">
        <h2>Listado</h2>
        {gastos.map(gasto => (
            <Fragment>
                <Gasto
                    key={gasto.id}
                    gasto={gasto}
                />
                <button>

                </button>

            </Fragment>
        ))}
    </div>
);

Listado.propTypes = {
    gastos: PropTypes.array.isRequired
}

export default Listado;
